import React from 'react';
//import {CurrentUserContext} from '../contexts/CurrentUserContext';
import { Link, withRouter } from 'react-router-dom';



function Login({}) {


  return ( 
      <section className="login__container">

          <form className="popup__form">
            <h3 className="popup__title">Вход</h3>
            <input
        required
        name="email"
        type="url"
        minLength="5"
        maxLength="40"
        className="popup__input"
        placeholder="Email" 
       //value={email || ""} 
        />
      <span className="popup__error popup__error_visible name-error" />
      <input
        required
        name="password"
        type="password"
        minLength="5"
        maxLength="5"
        className="popup__input"
        placeholder="Пароль" 
        //value={description || ""}
        />
      <span className="popup__error popup__error_visible password-error" />
            <button type="submit" 
                    className="popup__button">Войти</button>
          </form>

      </section>
    );
  } 

export default withRouter(Login);
